chess960 = function() {
  var all, fetch, res;
  res = [];
  all = [0, 1, 2, 3, 4, 5, 6, 7];
  fetch = function(lst, piece) {
    var p;
    p = lst[_.random(lst.length - 1)];
    _.remove(all, function(value) {
      return value === p;
    });
    return res[p] = piece;
  };
  fetch([0, 2, 4, 6], 'B');
  fetch([1, 3, 5, 7], 'B');
  fetch(all, 'Q');
  fetch(all, 'N');
  fetch(all, 'N');
  res[all[0]] = 'R';
  res[all[1]] = 'K';
  res[all[2]] = 'R';
  return res.join(' ');
};

